import { React } from "react";
import {
  BackgroundDiv,
  DivSuperior,
  DivTitulo,
  SubTitulo,
  TextoBranco,
  TiraAzul,
  Titulo,
} from "./index.js";

const HomePage = () => {
  return (
    <BackgroundDiv>
        <DivSuperior>
            <DivTitulo>
                <Titulo>{"Porco Rosso"}</Titulo>
                <SubTitulo>{"Pizzaria"}</SubTitulo>
            </DivTitulo>
                <TextoBranco>{"Entrar"}</TextoBranco>
                <TextoBranco>{"Cadastro"}</TextoBranco>
        </DivSuperior>
      <TiraAzul>
        <TextoBranco>{"menu"}</TextoBranco>
        <TextoBranco>{"sobre nós"}</TextoBranco>
      </TiraAzul>
    </BackgroundDiv>
  );
};

export { HomePage };
